package main

import (
    "strings"
)

func IntToMiniRoman(number int) string {
    if number < 1 || number > 1000 {
        return ""
    }

    var romanUnits = []struct {
        value int
        numeral string
    }{
        {1000, "m"},
        {900, "cm"},
        {500, "d"},
        {400, "cd"},
        {100, "c"},
        {90, "xc"},
        {50, "l"},
        {40, "xl"},
        {10, "x"},
        {9, "ix"},
        {5, "v"},
        {4, "iv"},
        {1, "i"},
    }

    var result strings.Builder

    for _, unit := range romanUnits {
        for number >= unit.value {
            result.WriteString(unit.numeral)
            number -= unit.value
        }
    }

    return result.String()
}
